import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import {Provide} from 'react';
import {store} from './store';

ReactDOM.render(

    <Provide store={store}>
      <App/>
    </Provide>

  ,
  document.getElementById('root')
);
